  - name: TEXT4000
    number: '6'
    value: "AMENDMENT DESRIPTION:   1.\tReport amended to correct the beginning debt
      balance due to Rosen Shingle Creek Golf Club. The balance reported on the 12/1/07-12/31/07
      Report was $379,415.36, but it was determined that due to a clerical error,
      this balance was had not been correctly reported on the prior reports. Because
      our software program made it extremely difficult to amend prior reports to correct
      this balance, we have made the adjustment with this report - when the error
      was actually discovered. The correct Balance as of the Beginning of this Period
      should be $362,219.14 which is what is reported with this report. A payment
      was made to American Express on 1/31/08 for $362,219.14 and is reflected on
      Schedule H4 page 203 with the itemized description on page 205. Because our
      software program is unable to link the payment and therefore show a Payment
      This Period on Schedule D for this debt item, we have shown the payment as a
      negative Amount Incurred This Period of $362,219.14 on Schedule D.  2.Report
      amended to disclose the allocation ratio for fundraising expenses on Schedule
      H2.  3. Report amended to clarify the descriptions on Schedule B for merchant
      discount - changed to credit card fees. The description of administration fees
      on Schedule H4 has been changed to Health Insurance admin fees to better clarify
      the purpose of this disbursement.  4. Report amended to itemize the reimbursements
      for office supplies - purpose changed to postage & copies and to itemize the
      reimbursements for utilities - purpose changed to utilities & telephone. The
      itemized detail for the utilities & telephone disbursement of $4,351.15 to Curt
      Reilly on 1/10/08 is reflected on pages 220 & 221 beginning with the City of
      Tallahassee and ending with Comcast Cable. This was linked to a debt on Schedule
      D and wouldnt print directly after the expenditure.    No expenditure was made
      on behalf of a specifically identified federal candidate. No expenditure was
      for a public communication that referred to a clearly identified candidate for
      Federal office and that promoted, supported, attacked or opposed any such candidate
      for Federal office. All disbursements for salaries and benefits disclosed on
      Schedule H4 are for employees who did not spend more than 25% of their compensated
      time during the reporting period on Federal election activities or activities
      in connection with a Federal election. The Committee uses the Escrow option
      for receipt of corporate in-kind donations as provided for by the Commission
      in Advisory Opinion 1992-33. The method ensures that prohibited sources are
      not used to fund the federal share of allocable activity expenses. There were
      no corporate in-kinds during this reporting period, however there were transfers
      to the escrow account as follows:   Administrative Escrow account and In-kinds
      \ 12/31/07 balance is $1,301.54  1/11/08 transfer to Administrative escrow account
      of $10,000 as reflected on Schedule H4   1/31/08 balance in Administrative escrow
      account of $11,301.54.  MD-08 Escrow account and In-kinds  12/31/07 balance
      is $3,229.43  1/11/08 transfer to MD-08 escrow account of $10,000 as reflected
      on Schedule H4   1/31/08 balance in MD-08 escrow account of $13,229.43.  The
      itemized detail for payment of $3,852.13 to Jason Gonzalez on 1/4/08 on Schedule
      H4 page 130 of the report begins on page 170 with ABC Fine Wine & Spirits and
      ends on page 171 with Sams Club. This was linked to an item on Schedule D and
      wouldnt print directly after the expenditure.  "
